function UserList(props) {
    const {name,age,phone} = props
  return (
    <div>
         <div className="cards">
      <div className="card card-one">
        <h2 className="card-title">{name}</h2>
        <p className="description">{age}</p>
        {}
      </div>
    </div>
    </div>
  )
}

export default UserList
